import {buttonImageStyle, paragraphStyle } from './styles';
import backgroundImg from '/Users/MandyNemshin/Desktop/Duke/Technify/FinalProj/tester/src/backgroundd.png';
import buttonImage from '/Users/MandyNemshin/Desktop/Duke/Technify/FinalProj/tester/src/button.png';

function App() {
  const handleClick = () => {
    alert('Button clicked!');
  };

  return (
    <div >
      <img src={backgroundImg} alt="Background 1" />
      <p style={paragraphStyle}>
        Duke football has evolved from humble beginnings into a powerhouse of resilience<br />
        and ambition. For decades, Duke’s football program has played under the looming<br />
        shadow of its celebrated basketball legacy, a quiet and persistent underdog <br />
        striving for recognition on a campus where the echoes of Cameron Indoor Stadium <br />
        often took center stage. Yet, through every season, win or lose, Duke football has<br />
        retained an indomitable spirit, fueled by the loyalty of its players and the unbreakable <br />
        dedication of its fans. This is a program that has fought to build a reputation in the <br />
        highly competitive world of college football, overcoming years of struggle to carve <br />
        out a place in the national conversation. <br /> <br />

        Today, Duke football stands as a testament to perseverance, with recent seasons witnessing 
        an extraordinary transformation. Bolstered by outstanding coaching led by Manny Diaz, a 
        roster of high-caliber  <br />
        athletes, and an unstoppable drive, Duke has become a formidable competitor on the field. With a strategic blend  <br />
        of talent and grit, the Blue Devils have captivated fans and sent shockwaves through the ACC, consistently  <br />
        challenging long-standing powerhouses and rewriting what it means to play Duke football. Game after game, their <br />
         newfound prowess is turning heads and rallying fans with an energy that resonates across campus and far beyond. Duke  <br />
         football is not merely having a moment—it’s crafting a new era, one marked by thrilling victories, unyielding teamwork, <br />
          and a legacy that will continue to shape the program for years to come. This rise to prominence is not just a phase but  <br />
          a powerful movement, proving that Duke is ready to redefine its place in college football history.</p>
      <img src={buttonImage} alt="Button" onClick={handleClick} style={buttonImageStyle} />
    </div>
  );
}

export default App;
